import style from "../Card/Card.jsx";

export const Card = ({ name, background_image, genres }) => {
  return (
    <div className={style.containt}>
      <img src={background_image} alt="" />
      <div>
        <h2>Name: {name}</h2>
        <h2>Genres: {genres}</h2>
      </div>
    </div>
  );
};
